import React, { useState } from 'react';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBIcon,
  MDBInput
} from 'mdb-react-ui-kit';
import logo from '../img/the_people_logo_2_top 2 copy.png'
import '../css/Login.css'

function App() {
  const [isPopupOpen, setPopupOpen] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Data untuk popup
  const popupData = [{
    title: "Welcome Back!",
    src: "https://open.spotify.com/playlist/2yU2fJR5X05fzWArc18JBn?si=RIeaDx6vQwiQJ2Hi6xPz7w&pi=a-mZZcvveFSJ6n",
    content: "You've successfully logged in. Enjoy your playlist!",
    genre: "Music",
    icon: "https://upload.wikimedia.org/wikipedia/commons/6/64/Spotify_icon.svg", // Icon Spotify
    textButton: "Check Our Playlist",
    message: "Enjoy listening!",
  }];

  const handleOpenPopup = () => {
    setPopupOpen(true);
    document.body.classList.add("overflow-hidden");
  };

  const handleClosePopup = () => {
    setPopupOpen(false);
    document.body.classList.remove("overflow-hidden");
  };

  const handleLogin = () => {
    // Di sini Anda bisa menambahkan validasi login, misalnya dengan memeriksa email dan password
    setIsLoggedIn(true);
    handleOpenPopup();
  };

  return (
    <MDBContainer fluid >
      <MDBRow>
        <MDBCol sm='6' style={{ overflow: 'hidden' }}>

          <div className='d-flex flex-row ps-0 pe-5 pt-5' >
            <MDBIcon fas icon="crow fa-3x me-3" style={{ color: '#709085' }} />
            <span className="h1 fw-bold mb-0"><img className='logo-login' src={logo} alt="logo" /></span>
          </div>

          <div className='d-flex flex-column justify-content-center h-custom-2 w-75 pt-4'>

            <h3 className="fw-normal mb-3 ps-5 pb-3" style={{ letterSpacing: '1px' }}>Log in</h3>

            <MDBInput wrapperClass='mb-4 mx-5 w-100' label='Email address' id='formControlLg' type='email' size="lg" />
            <MDBInput wrapperClass='mb-4 mx-5 w-100' label='Password' id='formControlLg' type='password' size="lg" />

            <MDBBtn className="mb-4 px-5 mx-5 w-100" color='info' size='lg' onClick={handleLogin}>
              Login
            </MDBBtn>
            <p className="small mb-5 pb-lg-3 ms-5"><a className="text-muted" href="#!">Forgot password?</a></p>
            <p className='ms-5'>Don't have an account? <a href="#!" className="link-info">Register here</a></p>

          </div>

        </MDBCol>

        <MDBCol sm='6' className='d-none d-sm-block px-0'>
          <img src="https://i.pinimg.com/1200x/59/47/33/5947333920d8f09737d017ecfef27b1c.jpg"
            alt="Login image" className="w-100" style={{ objectFit: 'cover', objectPosition: 'left' }} />
        </MDBCol>

      </MDBRow>

      {/* Popup logic */}
      {isPopupOpen && (
        <div className="popup-overlay" style={{ position: 'fixed', top: 0, left: 0, width: '100%', height: '100%', backgroundColor: 'rgba(0,0,0,0.7)', zIndex: 1000 }}>
          <div className="popup-content" style={{ backgroundColor: 'white', padding: '20px', borderRadius: '8px', width: '400px', margin: 'auto', marginTop: '20%' }}>
            <h2>{popupData[0].title}</h2>
            <p>{popupData[0].content}</p>
            <p>{popupData[0].message}</p>
            <a href={popupData[0].src} target="_blank" rel="noopener noreferrer">
              <MDBBtn color='info'>{popupData[0].textButton}</MDBBtn>
            </a>
            <br />
            <img src={popupData[0].icon} alt="Spotify icon" style={{ width: '40px', marginTop: '10px' }} />
            <br />
            <MDBBtn color='danger' onClick={handleClosePopup} style={{ marginTop: '10px' }}>Close</MDBBtn>
          </div>
        </div>
      )}

    </MDBContainer>
  );
}

export default App;
